import React from 'react'



export default function PrintCards(props) {
    return (
        props.cards.map((card) => 
                <div className="card">
                    <div className="photo">
                        {console.log("../img/" + card.img)}
                        <img src={`./../img/${card.img}`}></img>
                    </div>
                    <div className="card-text">
                        {card.text}
                    </div>
                </div>
        )
    )
}
